import React from 'react';

const Signin = () => {
    return (
        <article className="flex flex-wrap pv3 ph4 ba b--black-30 br2 w-50-m w-25-l shadow-4 center">
            <form className="measure">
                <fieldset id="sign-up">
                    <legend className="white ph3 " > Sign In </legend>
                </fieldset>
            </form>
        </article>
    );
}

export default Signin
